\"z\" \\c} {\"x\" 6, \"y\" 0.08506247852097504, \"z\" \\a} {\"x\" 7, \"y\" 0.9598734539937713, \"z\" \\b} {\"x\" 8, \"y\" 0.6669797656932094, \"z\" \\c}]}]]]], \"180\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"219\" [:div nil [:div nil]], \"275\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"258\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"253\" [:div nil [:div [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]]], \"188\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"277\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(defn abcd [x] (+ x 9))\"}]]], \"158\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"201\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"265\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]]], \"227\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/p1\\n\"}]]], \"263\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"157\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"185\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"266\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"175\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"300\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"155\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"290\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"202\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"195\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"234\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"193\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"295\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((0 1 5 1 4 0)\\n (5 0 0 3 2 4)\\n (1 4 5 2 2 0)\\n (5 1 3 3 3 2)\\n (5 3 4 3 5 2)\\n (5 4 3 1 4 4))\\n\"}]]], \"224\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"196\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"282\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"237\" [:div [:p/code {:code \"(def x\\n  (future\\n   (Thread/sleep 2000)\\n   (->> #(- (rand) 0.5)\\n        (repeatedly 999)\\n        (reductions +))))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/x\\n\"}]]], \"207\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"302\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"238\" [:div nil [:div [:p/markdown \"The following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"270\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"231\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"251\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"169\" [:div [:p/code {:code \"(def x\\n  (future\\n   (Thread/sleep 2000)\\n   (->> #(- (rand) 0.5)\\n        (repeatedly 999)\\n        (reductions +))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"232\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"274\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n 335887 0.6170428042490217 -0.8262658214136023), :limit 100, :svgWidth 100, :svgHeight 20}]]]]], \"225\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"294\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"203\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"172\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"278\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"176\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"247\" [:div nil [:div [:p/markdown \"The `A` function allows to define a Clojure atom that informs Notespace when it changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"212\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"199\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"210\" [:div [:p/code {:code \"^k/dataset\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (cycle \\\"abc\\\")}\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"186\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"261\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"152\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"181\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"284\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"184\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"173\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"246\" [:div [:p/code {:code \"(require '[notespace.api :refer [A]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"190\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"222\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"250\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"289\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"267\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"283\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"208\" [:div [:p/code {:code \"^k/hiccup\\n[:p/code {:code \\\"(defn abcd [x] (+ x 9))\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"276\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"166\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"218\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"194\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"168\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"241\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"293\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(0.06319601900908334\\n 0.49776725406620015\\n 0.8176120413319802\\n 0.5354118413669755\\n 0.7695416019448492\\n 0.6187264998949537\\n 1.0753567590462154\\n 1.4860176054482594\\n 1.638470777541716)\\n\"}]]], \"154\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"257\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((4 5 0 5 1 1)\\n (2 4 0 1 1 5)\\n (3 1 2 4 0 0)\\n (5 3 4 1 3 5)\\n (4 5 0 1 4 2)\\n (4 2 0 1 0 0))\\n\"}]]], \"209\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"239\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"240\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"271\" [:div nil [:div [:big [:big 3]]]], \"174\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"171\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"200\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"183\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"223\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"272\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"205\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (ran
